function Play({ playData, onFavorite }) {
    const { Title, Date, GenreType } = playData;

    return (
      <div className="play">
        <h2>{Title}</h2>
        <p>Date Published: {Date}</p>
        <p>Genre: {GenreType}</p>
        <button onClick={() => onFavorite(playData)}>Favorite</button>
      </div>
    );
  }

  export default Play;
